import './Header.css'
import green from '../../../images/blobs/blob-green.svg';
import rust from '../../../images/blobs/blob-rust.svg';
import purple from '../../../images/blobs/blob-purple.svg';
import yellow from '../../../images/blobs/blob-yellow.svg';
import black from '../../../images/blobs/blob-black.svg';
import beige from '../../../images/blobs/blob-beige.svg';

import Container from 'react-bootstrap/Container';

function Header(props) {
  return (
    <Container>
      <div className="header__container">
        <div className="text-right">
          <img className="header__blob"
            src={`
              ${props.blob === 'green' ? green : ''}
              ${props.blob === 'rust' ? rust : ''}
              ${props.blob === 'purple' ? purple : ''}
              ${props.blob === 'yellow' ? yellow : ''}
              ${props.blob === 'black' ? black : ''}
              ${props.blob === 'beige' ? beige : ''}
            `}
            alt={`
              ${props.blob === 'green' ? "Green circle" : ''}
              ${props.blob === 'rust' ? "Red circle" : ''}
              ${props.blob === 'purple' ? "Purple circle" : ''}
              ${props.blob === 'yellow' ? "Yellow circle" : ''}
              ${props.blob === 'black' ? "Black circle" : ''}
              ${props.blob === 'beige' ? "Beige circle" : ''}
            `}
          />
        </div>

        <h1 className={`header2
          ${props.subtitle ? 'header__headers' : 'mb-0'}
          ${props.center ? 'text-center' : ''}`}>
          {props.title}
        </h1>

        {props.subtitle &&
          <p className="header5 primary-green header__headers">{props.subtitle}</p>
        }
      </div>
    </Container>
  );
}

export default Header;
